INSERT INTO `cache_field` VALUES ('field:node:5','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2229:\"The following suggestions may help you to stay as healthy as possible and maintain an\r\noverall sense of well-being at this time.\r\nExercise can help to improve your energy and your sleep; it can fight off infections and can\r\nlift your spirits. You may wish to consult with your doctor before you begin exercising.\r\n• Make a habit of going outside 	 for short walks everyday, even better if you can go with\r\nsomeone whose company you enjoy. Increase the distance, as you are able.\r\n• Walking is not the only exercise encouraged, if you prefer another form of activity\r\n(i.e. swimming, yoga, gardening) that is fine. The goal is to be as active as you are able.\r\n• Do stretching exercises while you are at rest, for example: when watching TV.\r\n• Eating well is an important lifestyle choice. Drink plenty of water to keep hydrated.\r\n• Eat 5 or more vegetables per day. Fruits with skin are also helpful.\r\n• Choose whole grains over white (i.e. pasta and breads). This will help with constipation\r\nand provide extra nutrition.\r\n• Eat smaller amounts several times per day instead of three larger meals. This helps\r\nyou to get in the amount of nutrition and calories that your body needs to stay healthy\r\nparticularly at times when your appetite is poor. Eat even if you do not feel hungry.\r\n• Limit your alcohol intake. Discuss with your doctor if you are drinking more than 8 drinks\r\nper week.\r\n• Quitting smoking is the most important thing that you can do for your health now.\r\nIf you are interested in having some help to quit smoking, speak with your nurse who\r\ncan provide teaching and information. Nicotine is one of the most addictive substances\r\nknown; there is help available. Even if you do not feel ready to quit at this time, ask for\r\ninformation.\r\n• The Heart Check Smoking Cessation Program. . . . . . . . . . . . . . . . . . . . .613-761-4753\r\n• Ottawa Public Health Information Line ................ 613-580-6744, ext. 24179\r\n\r\n• Renfrew County & District Health Unit, Health Info Line .............613-735-8666\r\n\r\n• Leeds, Grenville & Lanark District Health Unit, Health Action Line ......613-345-5685\r\n• Eastern Ontario Health Unit, Tobacco Use Coordinator ..............613-933-1375\r\n \";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2375:\"<p>The following suggestions may help you to stay as healthy as possible and maintain an<br />\noverall sense of well-being at this time.<br />\nExercise can help to improve your energy and your sleep; it can fight off infections and can<br />\nlift your spirits. You may wish to consult with your doctor before you begin exercising.<br />\n• Make a habit of going outside 	 for short walks everyday, even better if you can go with<br />\nsomeone whose company you enjoy. Increase the distance, as you are able.<br />\n• Walking is not the only exercise encouraged, if you prefer another form of activity<br />\n(i.e. swimming, yoga, gardening) that is fine. The goal is to be as active as you are able.<br />\n• Do stretching exercises while you are at rest, for example: when watching TV.<br />\n• Eating well is an important lifestyle choice. Drink plenty of water to keep hydrated.<br />\n• Eat 5 or more vegetables per day. Fruits with skin are also helpful.<br />\n• Choose whole grains over white (i.e. pasta and breads). This will help with constipation<br />\nand provide extra nutrition.<br />\n• Eat smaller amounts several times per day instead of three larger meals. This helps<br />\nyou to get in the amount of nutrition and calories that your body needs to stay healthy<br />\nparticularly at times when your appetite is poor. Eat even if you do not feel hungry.<br />\n• Limit your alcohol intake. Discuss with your doctor if you are drinking more than 8 drinks<br />\nper week.<br />\n• Quitting smoking is the most important thing that you can do for your health now.<br />\nIf you are interested in having some help to quit smoking, speak with your nurse who<br />\ncan provide teaching and information. Nicotine is one of the most addictive substances<br />\nknown; there is help available. Even if you do not feel ready to quit at this time, ask for<br />\ninformation.<br />\n• The Heart Check Smoking Cessation Program. . . . . . . . . . . . . . . . . . . . .613-761-4753<br />\n• Ottawa Public Health Information Line ................ 613-580-6744, ext. 24179</p>\n<p>• Renfrew County &amp; District Health Unit, Health Info Line .............613-735-8666</p>\n<p>• Leeds, Grenville &amp; Lanark District Health Unit, Health Action Line ......613-345-5685<br />\n• Eastern Ontario Health Unit, Tobacco Use Coordinator ..............613-933-1375</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1475567993,1),('field:node:6','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:91:\"This is a static page and have a link or button to facebook group or page for peer support.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:99:\"<p>This is a static page and have a link or button to facebook group or page for peer support.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1475568054,1),('field:node:7','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:22:\"This is a static page.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:30:\"<p>This is a static page.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1475568054,1),('field_info:bundle:node:page','a:2:{s:9:\"instances\";a:1:{s:4:\"body\";a:13:{s:5:\"label\";s:4:\"Body\";s:6:\"widget\";a:4:{s:4:\"type\";s:26:\"text_textarea_with_summary\";s:8:\"settings\";a:2:{s:4:\"rows\";i:20;s:12:\"summary_rows\";i:5;}s:6:\"weight\";i:-4;s:6:\"module\";s:4:\"text\";}s:8:\"settings\";a:3:{s:15:\"display_summary\";b:1;s:15:\"text_processing\";i:1;s:18