INSERT INTO `field_revision_body` VALUES ('node','page',0,5,5,'und',0,'The following suggestions may help you to stay as healthy as possible and maintain an\r\noverall sense of well-being at this time.\r\nExercise can help to improve your energy and your sleep; it can fight off infections and can\r\nlift your spirits. You may wish to consult with your doctor before you begin exercising.\r\n• Make a habit of going outside 	 for short walks everyday, even better if you can go with\r\nsomeone whose company you enjoy. Increase the distance, as you are able.\r\n• Walking is not the only exercise encouraged, if you prefer another form of activity\r\n(i.e. swimming, yoga, gardening) that is fine. The goal is to be as active as you are able.\r\n• Do stretching exercises while you are at rest, for example: when watching TV.\r\n• Eating well is an important lifestyle choice. Drink plenty of water to keep hydrated.\r\n• Eat 5 or more vegetables per day. Fruits with skin are also helpful.\r\n• Choose whole grains over white (i.e. pasta and breads). This will help with constipation\r\nand provide extra nutrition.\r\n• Eat smaller amounts several times per day instead of three larger meals. This helps\r\nyou to get in the amount of nutrition and calories that your body needs to stay healthy\r\nparticularly at times when your appetite is poor. Eat even if you do not feel hungry.\r\n• Limit your alcohol intake. Discuss with your doctor if you are drinking more than 8 drinks\r\nper week.\r\n• Quitting smoking is the most important thing that you can do for your health now.\r\nIf you are interested in having some help to quit smoking, speak with your nurse who\r\ncan provide teaching and information. Nicotine is one of the most addictive substances\r\nknown; there is help available. Even if you do not feel ready to quit at this time, ask for\r\ninformation.\r\n• The Heart Check Smoking Cessation Program. . . . . . . . . . . . . . . . . . . . .613-761-4753\r\n• Ottawa Public Health Information Line ................ 613-580-6744, ext. 24179\r\n\r\n• Renfrew County & District Health Unit, Health Info Line .............613-735-8666\r\n\r\n• Leeds, Grenville & Lanark District Health Unit, Health Action Line ......613-345-5685\r\n• Eastern Ontario Health Unit, Tobacco Use Coordinator ..............613-933-1375\r\n ','','filtered_html'),('node','page',0,6,6,'und',0,'This is a static page and have a link or button to facebook group or page for peer support.','','filtered_html'),('node','page',0,7,7,'und',0,'This is a static page.','','filtered_html');
