INSERT INTO `search_dataset` VALUES (5,'node',' healthy lifestyle the following suggestions may help you to stay as healthy as possible and maintain an overall sense of wellbeing at this time exercise can help to improve your energy and your sleep it can fight off infections and can lift your spirits you may wish to consult with your doctor before you begin exercising make a habit of going outside for short walks everyday even better if you can go with someone whose company you enjoy increase the distance as you are able walking is not the only exercise encouraged if you prefer another form of activity ie swimming yoga gardening that is fine the goal is to be as active as you are able do stretching exercises while you are at rest for example when watching tv eating well is an important lifestyle choice drink plenty of water to keep hydrated eat 5 or more vegetables per day fruits with skin are also helpful choose whole grains over white ie pasta and breads this will help with constipation and provide extra nutrition eat smaller amounts several times per day instead of three larger meals this helps you to get in the amount of nutrition and calories that your body needs to stay healthy particularly at times when your appetite is poor eat even if you do not feel hungry limit your alcohol intake discuss with your doctor if you are drinking more than 8 drinks per week quitting smoking is the most important thing that you can do for your health now if you are interested in having some help to quit smoking speak with your nurse who can provide teaching and information nicotine is one of the most addictive substances known there is help available even if you do not feel ready to quit at this time ask for information the heart check smoking cessation program 6137614753 ottawa public health information line 6135806744 ext 24179 renfrew county district health unit health info line 6137358666 leeds grenville lanark district health unit health action line 6133455685 eastern ontario health unit tobacco use coordinator 6139331375  ',0),(6,'node',' peer support this is a static page and have a link or button to facebook group or page for peer support  ',0),(7,'node',' symptoms this is a static page  ',0);
